import axios from "axios";
import {GET_ERRORS,GET_BOOKMARKS} from "./types";

export const createBookmark = (bookmark,history) => async dispatch =>{
    try {
        const  res = await axios.post("http://localhost:8080/bookmarks/create",bookmark);
        history.push("/bookmarks")
    }catch (err) {
        dispatch({
            type:GET_ERRORS,
            payload:err.response.data
        })
    }
};

export const getBookmarks = () => async dispatch =>{
    const res = await axios.get("http://localhost:8080/bookmarks")
};
